import React from 'react';
import '../styles/App.css';

const Contact = () => {
  return (
    <main className="contact-container">
      <h1>Contact</h1>

      <div className="contact-info">
        <p className="studio-info">
          Cake Nygard Studio<br />
          Minneapolis, Minnesota
        </p>

        <p className="contact-section">
          <span className="contact-label">For inquiries:</span><br />
          <a href="mailto:contact@cakenygard.com" className="contact-link">contact@cakenygard.com</a>
        </p>

        <p className="contact-section">
          <span className="contact-label">Instagram:</span><br />
          <a href="https://www.instagram.com/cakenygardart/" target="_blank" rel="noopener noreferrer" className="contact-link">@cakenygardart</a>
        </p>

        <p className="contact-note">
          For sales, collaborations, or exhibition opportunities, please contact via email.
        </p>
      </div>
    </main>
  );
};

export default Contact;
